import React from 'react';

export default function Experiences() {
  const experience = {
    title: "Software Engineer – Smart Desert Pvt Ltd | Bengaluru",
    period: "May 2022 – Aug 2024",
    points: [
      "Built a social media platform using the MERN stack (MongoDB, Express.js, React, Node.js), with a focus on scalable architecture and real-time user experience.",
      "Integrated Stripe APIs for direct customer transactions and automated the order system, reducing processing time by 20%. Oversaw SDLC phases using Jira.",
      "Collaborated across teams to ensure data quality (SQL), system efficiency (Python scripts), and version control using Git and VS Code. Led design reviews and ensured compliance with local regulations."
    ]
  };

  return (
    <section id="experience" className="timeline-section">
  <h2 className="section-title">My Experiences</h2>
  <div className="timeline">
    <div className="timeline-item">
      <div className="timeline-dot"></div>
      <div className="timeline-content">
        <h3>Software Engineer – Smart Desert Pvt Ltd | Bengaluru</h3>
        <p className="date">May 2022 – Aug 2024</p>
        <ul>
          <li>Built a social media platform using the MERN stack (MongoDB, Express.js, React, Node.js)...</li>
          <li>Integrated Stripe APIs for direct customer transactions and automated the order system...</li>
          <li>Collaborated across teams to ensure data quality (SQL), system efficiency (Python scripts)...</li>
        </ul>
      </div>
    </div>
  </div>
</section>

  );
}
